import { useSelector } from "react-redux";

const DetailedPokemon = () => {
  const pokemonq = useSelector((state) => state.pokemons);

  return (
    <div>
      <span>{pokemon.nombre}</span>
      <section>
        <img
          src={pokemon.imagen}
          alt="Pokemon Imagen"
        />
        <div>
          <span>Height: {pokemon.altura} cm</span>
          <span>Weight: {pokemon.peso} kg</span>
    
        </div>
      </section>
    </div>
  );
};

export default DetailedPokemon;
